  //     this.changeBtn("right", newVal)
  //   },
  // },
  methods:{
    sendMsg(){
      console.log(123)
      this.$mqtt.publish('VueMqtt/publish1', "Hello ")
    },
    reset(){
      this.up = 0
      this.down = 0
      this.left = 0
      this.right = 0
      this.action()
    },
    add(){
      this.up = this.up+1
      this.down = this.down+1
      this.left = this.left+1
      this.right = this.right+1
    },
    sub(){
      this.up = this.up-1
      this.down = this.down-1
      this.left = this.left-1
      this.right = this.right-1
    },
    changeBtn(action, newVal){
      if(newVal == 0){
        TweenMax.set(`#btn2 > #btn2_${action}`, {opacity:0})
        TweenMax.set(`#btn3 > #btn3_${action}`, {opacity:0})
        TweenMax.set(`#btn3_click > #btn3_${action}_click`, {opacity:0})

        TweenMax.set(`#btn1 > #btn1_${action}`, {opacity:1})
      }
      if(newVal == 1){
        TweenMax.set(`#btn1 > #btn1_${action}`, {opacity:0})
        TweenMax.set(`#btn2 > #btn2_${action}`, {opacity:1})
      }
      if(newVal == 2){
        TweenMax.set(`#btn2 > #btn2_${action}`, {opacity:0})
        TweenMax.set(`#btn3 > #btn3_${action}`, {opacity:1})
      }
      if(newVal == 3){
        TweenMax.set(`#btn2 > #btn2_${action}`, {opacity:0})
        TweenMax.set(`#btn3_click > #btn3_${action}_click`, {opacity:1})
      }
    },
    action(){
      TweenMax.set('#btn1 > *', {opacity:0})
      TweenMax.set('#btn2 > *', {opacity:0})
      TweenMax.set('#btn3 > *', {opacity:0})
      TweenMax.set('#head > *', {opacity:0})
      TweenMax.set('#btn3_click  > *', {opacity:0})
      TweenMax.set('#head > #piohead1_normal', {opacity:1})
    }
  },
  mqtt: {
    /** 'VueMqtt/publish1' or '+/publish1' */
    'VueMqtt/publish1' (data) {
      this.buff = this.buff + data + '<br>'
    }
  },
  
  mounted(){
    this.action()
    TweenMax.to('#btn1 > *', 2, {opacity:1})
    this.reset()
    this.$mqtt.subscribe('VueMqtt/#')
    
  }
}
</script>
